periência em laboratórios os 3 anos do ensino médio '),(14634,'2020-03-12','09:27','fmontareg_csv','Parametros: l=%\"2020/03/09 12:21:39 PM GMT-3\",\"Edivaldo Alves Leal Filho\",\"3720790/PI\",\"06689593398\",\"20169037090\",\"edlealphb@gmail.com\",\"edlealphb@gmail.com\",\"(86)995580459\",\"Clínica Escola de  Psicologia\",\"Manhã;Tarde\",\"Me chamo Edivaldo Alves Leal Filho, atualmente tenho 24 anos. Sou estudante de Psicologia pela Universidade Federal do Piauí - Campus Reis Veloso em Parnaíba/PI, no momento atual estou cursando o 9° período. Participei do Laboratório de Neurociência e Psicologia Social ( LANPSO) da UFPI sob a supervisão  da  Prof. Dra. Paloma Cavalcante Bezerra De Medeiros, colaborando com desenvolvimento de pesquisas e artigos científicos. Participei do Projeto Fazendo arte e cultura na Educação (FACE) da UFPI, sob supervisão da Psicóloga do Núcleo de assistência Estudantil (NAE) Fernanda Maria de Oliveira, contribui com o desenvolvimento de ações de cuidado à saúde por meio de ações culturais e artísticas como formas estratégicas de promoção e prevenção à saúde mental da comunidade acadêmica, atividades como : Teatro, Atividade com Música, Atividade com  Dança e Atividade de Acolhimento aos estudantes.Atualmente inicie o estagio Profissional II na Clinica Escola de Psicologia e faço pesquisas relacionado a música e saúde mental sob a ótica da Terapia Cognitiva Comportamental. Acredito que com a oportunidade de está  participando ativamente na Clinica Escola de Psicologia colaborando com as respectivas atividades em beneficio a comunidade será uma experiência importante na minha formação acadêmica e qualificação profissional,minhas expectativas são as mais positivas e fazer o meu melhor. \"% info=1 nc=11 lt=1603 s=Possuo certificado de curso técnico em informática, por meio do Instituto Federal do Piauí, Campus Picos. E tive experiência em laboratórios os 3 anos do ensino médio  j=0 k=26'),(14635,'2020-03-12','09:27','j=<> ','info=1 k=26 j=1 s=2